function initialize(){autocomplete=new google.maps.places.Autocomplete(document.getElementById("input-22"),{types:["geocode"]}),google.maps.event.addListener(autocomplete,"place_changed",function(){fillInAddress()})}function fillInAddress(){var e=autocomplete.getPlace();for(var o in componentForm)document.getElementById(o).value="",document.getElementById(o).disabled=!1;for(var t=0;t<e.address_components.length;t++){var n=e.address_components[t].types[0];if(componentForm[n]){var a=e.address_components[t][componentForm[n]];document.getElementById(n).value=a}}}function geolocate(){navigator.geolocation&&navigator.geolocation.getCurrentPosition(function(e){var o=new google.maps.LatLng(e.coords.latitude,e.coords.longitude),t=new google.maps.Circle({center:o,radius:e.coords.accuracy});autocomplete.setBounds(t.getBounds())})}var placeSearch,autocomplete,componentForm={street_number:"short_name",route:"long_name",locality:"long_name",administrative_area_level_1:"short_name",country:"long_name",postal_code:"short_name"};